import styled from 'styled-components'

const Footer = styled.footer`
    height: 120px;
    background-color: #222;
    color: #fff;
`;

const Layout: React.FunctionComponent<Props> = ({
}) => (
    <div>
        <Footer></Footer>
    </div>
)

export default Layout
